import './App.css';
import React from 'react';
import TodoList from './TodoList';

function App() {
  return (
    <div className="App">
       <TodoList />
      <header className="App-header">
  <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
      </header>
    </div>
  );
}

export default App;
